import React from "react";
import { Container, Row, Col } from "react-bootstrap";

import Card from "../Card";

const Books = (props) => {
  return (
    <div className="Books">
      <Container>
        <Row>
          <Card />
        </Row>
        <Row>
          <Card />
        </Row>
      </Container>
    </div>
  );
};

export default Books;
